[Form]
public class WHSShipmentDetails extends FormRun
{
    private WHSShipmentDetailsFormArgs shipmentDetailsFormArgs;

    [SysObsolete('Use WHSShipmentDetailsFormArgs shipmentDetailsFormArgs instead.', false, 10\02\2023)]
    protected SalesTable                      salesTableArgs;
    [SysObsolete('Use WHSShipmentDetailsFormArgs shipmentDetailsFormArgs instead.', false, 10\02\2023)]
    protected SalesLine                       salesLineArgs;
    [SysObsolete('Use WHSShipmentDetailsFormArgs shipmentDetailsFormArgs instead.', false, 10\02\2023)]
    protected InventTransferTable             inventTransferTableArgs;
    [SysObsolete('Use WHSShipmentDetailsFormArgs shipmentDetailsFormArgs instead.', false, 10\02\2023)]
    protected WHSShipmentTable                shipmentTableArgs;

    protected WHSShipmentDetailsForm          shipmentDetailsForm;
    protected WHSShipPlanningListPageForm     shipPlanningListPageForm;
    protected str                             shipmentIdList;
    private boolean shipmentLatestWaveLabelDetailsViewLinkedTypePassiveFlight = WHSShipmentLatestWaveLabelDetailsViewLinkedTypePassiveFlight::instance().isEnabled();
    private readonly boolean populatePackingSlipIdFromShipmentFlightEnabled = WHSPopulatePackingSlipIdFromShipmentFlight::instance().isEnabled();
}

    public void init()
    {
        shipmentDetailsFormArgs = WHSShipmentDetailsFormArgs::newFromArgs(element.args());

        shipmentIdList = element.args().parm();

        shipPlanningListPageForm    = new WHSShipPlanningListPageForm();
        shipmentDetailsForm         = new WHSShipmentDetailsForm();

        super();

		if (!shipmentLatestWaveLabelDetailsViewLinkedTypePassiveFlight)
		{
			WHSShipmentLatestWaveLabelDetails_ds.linkType(DataSourceLinkTypePropertyValues::Passive);
		}
		WHSShipmentLatestWaveLabelDetails_ds.object(fieldNum(WHSShipmentLatestWaveLabelDetails, WaveLabelsPrinted)).visible(false);
		WHSShipmentLatestWaveLabelDetails_ds.object(fieldNum(WHSShipmentLatestWaveLabelDetails, WaveLabelsPrintedBy)).visible(false);
		WHSShipmentLatestWaveLabelDetails_ds.object(fieldNum(WHSShipmentLatestWaveLabelDetails, WaveLabelsPrintedDateTime)).visible(false);

		displayWaveLabelIsPrinted.visible(true);
		displayWaveLabelsPrintedBy.visible(true);
		displayWaveLabelsPrintedDateTime.visible(true);

        if (!TmsUsmcaCertificateOfOriginFeature::isEnabled())
        {
            TMSUsmcaCertificateOfOrigin.visible(false);
        }

        WHSParameters whsParameters = WHSParameters::find();
        boolean shouldReceivingCompletedFieldsBeVisible = whsParameters.CaptureReceivingCompletedPackingSlip != WHSCaptureReceivingCompletedPackingSlip::Never;
        this.toggleReceivingCompletedFields(shouldReceivingCompletedFieldsBeVisible);

        PackingSlipParameters.visible(populatePackingSlipIdFromShipmentFlightEnabled);
    }

private void toggleReceivingCompletedFields(boolean _isActive)
{
    WHSShipmentTable_ds.object(fieldNum(WHSShipmentTable, ReceivingCompletedPackingSlipId)).visible(_isActive);
    WHSShipmentTable_ds.object(fieldNum(WHSShipmentTable, ReceivingCompletedDocumentDate)).visible(_isActive);
}

public void run()
{
    super();
    InventTransId inventTransId = shipmentDetailsFormArgs.inventTransId;
    if (inventTransId)
    {
        WHSShipmentId shipmentId = WHSLoadLine::getShipmentId(inventTransId);
        element.args().lookupRecord(WHSShipmentTable::find(ShipmentId));
        whsShipmentTable_ds.research(false);
    }
}

/// <summary>
/// Creates list of shipment IDs.
/// </summary>
public void createShipmentIdList()
{           
    if (shipmentDetailsFormArgs.argsRecord)
    {
        InventTransType inventTransType = shipmentDetailsFormArgs.inventTransType;
        WHSOrderNum orderNum = shipmentDetailsFormArgs.orderNum;

        shipmentIdList = shipmentDetailsForm.createShipmentIdFilter(orderNum, inventTransType);
    }
}

public void init()
{
    super();

    QueryBuildDataSource shipmentTable = whsShipmentTable_q.dataSourceTable(tableNum(WHSShipmentTable));

    if (!shipmentIdList)
    {
        element.createShipmentIdList();
    }

    if (shipmentIdList)
    {
        shipmentTable.addRange(fieldNum(WHSShipmentTable, ShipmentId)).value(shipmentIdList);
        whsShipmentTable_ds.query().dataSourceTable(tableNum(WHSShipmentTable)).clearDynalinks();
    }
    else
    {
        if (shipmentDetailsFormArgs.isOpenedFromOrder)
        {
            shipmentTable.addRange(fieldNum(WHSShipmentTable, OrderNum)).value(shipmentDetailsFormArgs.orderNum);
            shipmentTable.addRange(fieldNum(WHSShipmentTable, WorkTransType)).value(shipmentDetailsFormArgs.workTransTypeQueryValue);
        }
        else if (shipmentDetailsFormArgs.isOpenedFromShipment)
        {
            shipmentTable.addRange(fieldNum(WHSShipmentTable, ShipmentId)).value(shipmentDetailsFormArgs.ShipmentId);
        }
    }

    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayTotalVolume));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayTotalWeight));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayDropOffDate));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayPickUpDate));
}

private void enableTMS(boolean _enable)
{
    TransportationActionTab.enabled(_enable);
    HeaderTransportation.enabled(_enable);

    TMSPackingList.enabled(_enable);
    TMSCertificateOfOrigin.enabled(_enable);
    TMSCoCCertificateOfOrigin.enabled(_enable);
    TMSCommercialInvoice.enabled(_enable && whsShipmentTable.WorkTransType  == WHSWorkTransType::Sales);
}

public int active()
{
    int ret = super();

    this.enableTMS(whsShipmentTable.canUseTMSActions());
    this.enableHMIM(HMIMShipConfirm::isEnabledForShipment(whsShipmentTable));

    shipmentDetailsForm.enableConsolidateShipments(btnConsolidateShipments, whsShipmentTable);

    shipmentDetailsForm.enableTransferShipment(btnTransfer, whsShipmentTable);
    shipmentDetailsForm.enableTransferShipmentNew(btnTransferNew, whsShipmentTable);

    whsShipmentLocationChange.enabled(whsShipmentTable.ShipmentStatus != WHSShipmentStatus::Shipped);
    skipWorkLine.enabled(whsShipmentTable.ShipmentStatus > WHSShipmentStatus::Open && whsShipmentTable.ShipmentStatus < WHSShipmentStatus::Shipped);
    printPickList.enabled(whsShipmentTable.ShipmentStatus >= WHSShipmentStatus::Waved);
    workButton.enabled(whsShipmentTable.canHaveWork());

    btnOutboundShipConfirm.enabled(WHSShipConfirm::isShipConfirmEnabledForShipment(whsShipmentTable));
    btnPostPackingSlip.enabled(WHSShipConfirm::isPackingSlipEnabledForShipment(whsShipmentTable));
    PackingSlipParameters.allowEdit(populatePackingSlipIdFromShipmentFlightEnabled && whsShipmentTable.canUsePreallocatedPackingSlip());
    btnSendASN.enabled(WHSShipConfirm::isSendASNEnabledForShipment(whsShipmentTable));
    btnBillOfLading.enabled(WHSShipConfirm::isBOLEnabledForShipment(whsShipmentTable));
    WHSWaveLabel.enabled(WHSWaveLabel::existShipmentId(WHSShipmentTable.ShipmentId));

    OutboundShipmentProcessingPolicy.visible(whsShipmentTable.LoadDirection == WHSLoadDirection::Outbound);

    FormDataObject field;

    if (whsShipmentTable.LoadId == '' && whsShipmentTable.ShipmentStatus != WHSShipmentStatus::Shipped)
    {
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, CarrierCode));
        field.allowEdit(true);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, CarrierServiceCode));
        field.allowEdit(true);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, DlvTermId));
        field.allowEdit(true);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, CarrierGroupCode));
        field.allowEdit(true);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, ModeCode));
        field.allowEdit(true);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, BrokerCode));
        field.allowEdit(true);
    }
    else
    {
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, CarrierCode));
        field.allowEdit(false);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, CarrierServiceCode));
        field.allowEdit(false);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, DlvTermId));
        field.allowEdit(false);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, CarrierGroupCode));
        field.allowEdit(false);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, ModeCode));
        field.allowEdit(false);
        field = whsShipmentTable_ds.object(fieldNum(WHSShipmentTable, BrokerCode));
        field.allowEdit(false);
    }

    if (whsShipmentTable.LoadDirection != WHSLoadDirection::Inbound)
    {
        element.toggleReceivingCompletedFields(false);
    }

    return ret;
}

/// <summary>
/// If all load lines are for the same orderNum as on the shipment header, returns the shipment orderNum,
/// otherwise returns empty string.
/// </summary>
display WHSOrderNum orderNum(WHSShipmentTable _whsShipmentTable)
{
    return WHSShipmentTable::hasMixedOrderTypes(_whsShipmentTable) ? '' : _whsShipmentTable.OrderNum;
}

private void enableHMIM(boolean _enable)
{
    HMIMCarrOfMerchByRoad.enabled(_enable);
    HMIMMultimodalDG.enabled(_enable);
    HMIMShipperDeclaration.enabled(_enable);
    HMIMShipmentSummary.enabled(_enable);
    HMIMVerifiedGrossMass.enabled(_enable);
}

