    btnRemoveLine.enabled(whsLoadLine.LoadId != '');

    unShipQty.enabled(whsLoadLine.isShippedQuantityReductionAllowed());

    return ret;
}

public void init()
{
    super();

    whsLoadLine_q.dataSourceTable(tableNum(WHSLoadLine)).addRange(fieldNum(WHSLoadLine, ShipmentId)).value(SysQuery::valueNotEmptyString());

    this.cacheAddMethod(tableMethodStr(WHSLoadLine, displayPickUpDate));
    this.cacheAddMethod(tableMethodStr(WHSLoadLine, displayDropOffDate));
}

